 * @param menic Objekt, ktery zada o zmenu rozmeru. Jakmile je jednou tento objekt nastaven, nesmi
 *     jiz rozmer platna menit nikdo jiny.
 */
public synchronized void setKrokRozmer(int krok, int pSirka, int pVyska, Object menic) {
  if (menic != vlastnikPovoleniZmenyKroku) {
    if (vlastnikPovoleniZmenyKroku == null) {
      vlastnikPovoleniZmenyKroku = menic;
    } else {
      throw new IllegalStateException("Zmena kroku a rozmeru neni danemu objektu povolena");
    }
  }
  // Overeni korektnosti zadanych parametru
  Dimension obrazovka = Toolkit.getDefaultToolkit().getScreenSize();
  if ((krok < 1)
      || (pSirka < 2)
      || (obrazovka.width < sirkaBodu)
      || (pVyska < 2)
      || (obrazovka.height < vyskaBodu)) {
    throw new IllegalArgumentException(
        "\nSpatne zadane rozmery: "
            + "\n krok ="
            + krok
            + " bodu,"
            + "\n sirka="
            + pSirka
            + " poli = "
            + pSirka * krok
            + " bodu,"
            + "\n vyska="
            + pVyska
            + " poli = "
            + pVyska * krok
            + " bodu,"
            + "\n obrazovka= "
            + obrazovka.width
            + ""
            + obrazovka.height
            + " bodu\n");
  }

  sirkaBodu = pSirka * krok;
  vyskaBodu = pVyska * krok;

  okno.setResizable(true);
  platno.setPreferredSize(new Dimension(sirkaBodu, vyskaBodu));
  okno.pack();
  okno.setResizable(false);

  obrazPlatna = platno.createImage(sirkaBodu, vyskaBodu);
  kreslitko = new Kreslitko((Graphics2D) obrazPlatna.getGraphics());
  kreslitko.setPozadi(barvaPozadi);

  int stary = this.krok;
  this.krok = krok;
  this.sloupcu = pSirka;
  this.radku = pVyska;

  pripravCary();

  // if( hlasitZmenyRozmeru && (krok != stary) )
  // {
  // nekreslit++; {
  // for( IPrizpusobivy ip : prizpusobivi ) {
  // ip.krokZmenen(stary, krok);
  // }
  // }nekreslit--;
