public static void main(String[] args) {
  JFrame frame = new JFrame();
  // dimmy:
  VFSTransfer transfer =
      new VFSTransfer(
          null,
          "Transfer",
          new VRL("file", "host", "/source"),
          new VRL("file", "host", "/dest"),
          true);

  TransferMonitorPanel inst = new TransferMonitorPanel(transfer);

  frame.add(inst);
  frame.pack();
  frame.setVisible(true);

  int max = 1000 * 1024;
  int dif = 50 * 1024;
  int step = 1024;

  transfer.startTask("TransferTask", max);

  for (int i = 0; i <= max; i += step) {
    if (transfer.isCancelled()) {
      transfer.logPrintf("\n*** CANCELLED ***\n");
      break;
    }

    String subTaskName = "Transfer #" + i / dif;

    if ((i % dif) == 0) {
      transfer.startSubTask(subTaskName, dif);
      transfer.logPrintf("--- New Transfer ---\n -> nr=" + i / dif + "\n");
    }

    transfer.updateTaskDone(i);
    transfer.updateSourcesDone(i / dif);
    transfer.updateSubTaskDone(subTaskName, i % dif);

    // Following method can only called by package members!
    // Do update here:
    inst.update(false);

    try {
      Thread.sleep(50);
    } catch (InterruptedException e) {
      e.printStackTrace();
    }
  }

  inst.update(true);

  transfer.endTask(null);
}

public JList showMultiSelectionBox(
    List<ConfigType> configs,
    String frameTitle,
    String mainButton,
    final ActionListener callback,
    boolean allowMultipleSelection) {
  final JFrame frame = new JFrame(frameTitle);

  typeMaxWidth = 0;
  JList list = createMulitSelectionList(configs, allowMultipleSelection);
  JScrollPane scroller = new JScrollPane(list);
  scroller.setPreferredSize(new Dimension(350, 450));

  JPanel mainPanel = new JPanel();
  mainPanel.setLayout(new BorderLayout());
  mainPanel.add(scroller, BorderLayout.CENTER);

  JPanel buttonPanel = new JPanel();
  JButton delete = new JButton(mainButton);
  delete.addActionListener(
      new ActionListener() {

        @Override
        public void actionPerformed(ActionEvent e) {
          callback.actionPerformed(e);
          frame.dispose();
        }
      });

  JButton cancel = new JButton("Cancel");
  cancel.addActionListener(
      new ActionListener() {
        @Override
        public void actionPerformed(ActionEvent e) {
          frame.dispose();
        }
      });

  buttonPanel.add(delete);
  buttonPanel.add(cancel);

  mainPanel.add(buttonPanel, BorderLayout.SOUTH);
  frame.setContentPane(mainPanel);

  frame.setDefaultCloseOperation(JFrame.DISPOSE_ON_CLOSE);
  frame.pack();
  frame.setVisible(true);

  return list;
}

