                  float f1 =
                      (float) (3 * Math.sqrt(Math.pow(x - (-0.8), 2) + Math.pow(y - (-0.8), 2)));
                  float f2 =
                      (float) (3 * Math.sqrt(Math.pow(x - (-0.6), 2) + Math.pow(y - (-0.5), 2)));
                  return new Color(Math.min(f1, 1.0f), Math.min(f2, 1.0f), 0.0f);
                }
              });
    }

